import Logo from "./Logo";
import Navigation from "./Navigation";
import Icon from "./Icon";
import "./Header.css"

function Headers() {
    co
    return (
        <div className="header_1">
        <div className="logo">
            <Logo />
        </div>
        <div className="navigation">
            <Navigation />
        </div>
        <div className="icon">
            <Icon />
        </div>
        </div>
    )
}
export default Headers;
